  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <Form>
          <input />
          <input />
          <Button type="submit">Login</Button>
        </Form>
      </div>
    );
  }
}

export default LoginPage;
